import React from 'react';
import cl from './Posts.module.css';

const Posts = () => {
    return (
        <div className={cl.content}>
            <div>
                My posts
                <div>
                    New post
                </div>
                <div>
                    <div className={cl.item}>
                        post 1
                    </div>
                    <div className={cl.item}>
                        post 2
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Posts;
